function App() {
  return (
    <div className="container">
      <h1 className="title">Buscador CEP </h1>
      <div className="containerInput">
        <input type="text"
        placeholder="Digte seu CEP.."
        />
        <button className="buttonSearch">
          <FiSearch size={25}  color="#000"/>
            </button>
      </div>
    </div>
  );
}

export default App;
